Content creation should be investable. 

@MrBeastYT should be able to raise capital for “bigger videos” where communities/fans can invest in the revenue upside. 

Raise $5M, investors receive 100% of proceeds up to 120% of their principle. Let him focus on creating. https://t.co/K1R3SUuO0M

